import React from 'react'

export default function Alert(props) {
  return (
    props.alert && <div>
      <div className="success success-warning alert-dismissible fade show" role="alert">
      <strong>{props.alert.type}! </strong> {props.alert.message}
</div>
    </div>
  )
}
